import PicContainer from "../PicContainer/PicContainer";
import "./ChefOfTheWeekSlide.scss";
import onzaImg from "../../assets/restaurants/onza/onza.png";
import kitchenImg from "../../assets/restaurants/kitchen-market/kitchen-market.png";
import mashyaImg from "../../assets/restaurants/mashya/mashya.png";

const RESTAURANTS = [
  {
    name: "Onza",
    pic: onzaImg,
  },
  {
    name: "Kitchen Market",
    pic: kitchenImg,
  },
  {
    name: "Mashya",
    pic: mashyaImg,
  },
];

const ChefOfTheWeekSlide = () => {
  return (
    <>
      <div className="chef-slide-title">Yossi's restaurants :</div>
      <div className="chef-slide">
        {RESTAURANTS.map((rest) => {
          return (
            <PicContainer
              type="rest"
              pic={rest.pic}
              title={rest.name}
              text=" "
              icons={[]}
              price=""
            />
          );
        })}
      </div>
    </>
  );
};

export default ChefOfTheWeekSlide;
